import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, IconButton, Divider } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import HomeIcon from '@mui/icons-material/Home';
import InfoIcon from '@mui/icons-material/Info';
import ContactMailIcon from '@mui/icons-material/ContactMail';
import './SideNav.css'; // Import the CSS file for additional styling

const SideNav = ({ darkMode }) => {
  const [visible, setVisible] = useState(false);

  const toggleNav = () => {
    setVisible(!visible);
  };

  return (
    <>
      <IconButton onClick={toggleNav} style={{ position: 'fixed', top: '20px', left: '20px', zIndex: 1100, cursor: 'pointer', color: darkMode ? 'white' : 'black' }}>
        <MenuIcon />
      </IconButton>
      <Drawer anchor="left" open={visible} onClose={toggleNav}>
          <List>
            <ListItem component={Link} to="/" button="true">
              <ListItemIcon><HomeIcon style={{ color: darkMode ? 'green' : 'inherit' }} /></ListItemIcon>
              <ListItemText primary="Home" style={{ color: darkMode ? 'black' : 'inherit' }} />
            </ListItem>
            <Divider />
            <ListItem component={Link} to="/about" button="true">
              <ListItemIcon><InfoIcon style={{ color: darkMode ? 'green' : 'inherit' }} /></ListItemIcon>
              <ListItemText primary="About" style={{ color: darkMode ? 'black' : 'inherit' }} />
            </ListItem>
            <Divider />
            <ListItem component={Link} to="/contact" button="true">
              <ListItemIcon><ContactMailIcon style={{ color: darkMode ? 'green' : 'inherit' }} /></ListItemIcon>
              <ListItemText primary="Contact" style={{ color: darkMode ? 'black' : 'inherit' }} />
            </ListItem>
          </List>
      </Drawer>
    </>
  );
};

export default SideNav;
